import React from 'react';
import Chip from '@mui/material/Chip';
import Stack from '@mui/material/Stack';

const Provenance = () => {
  return (
    <div style={{ paddingTop: '100px' }}>
      <h1 style={{ fontSize: '3rem' }} className="text-center mb-20">Provenance Security</h1>
      <p style={{ fontSize: '2rem', paddingLeft: '50px' }}>Overview</p>
      <p style={{ fontSize: '1.2rem', paddingLeft: '50px', paddingTop: '20px' }}>Provenance Security is an innovative cybersecurity platform aiming to help security analysts identify and resolve alerts 
      through the use of provenance graphs. These graphs along with additional statistics provide data to better understand potential threats. 
      Our goal with this website is to provide an interactive experience for investigation and resolution of any security issues. 
      <br></br>
      <br></br>
      My team and I at Illinois Design Consulting meticulously designed the user interface of this cybersecurity website to provide security analysts 
      an intuitive and visually appealing experience. We wanted the navigation experience to be effortless. </p>
      {/* Add more details as needed */}
      <br></br>
      <p style={{ fontSize: '2rem', paddingLeft: '50px' }}>Skills Used</p>
      <Stack direction="row" spacing={1} sx={{ mt: 5, paddingLeft: '50px' }}>
          <Chip label="Figma" />
          <Chip label="UI/UX" />
          <Chip label="Miro" />
          <Chip label="Visual Design" />
          <Chip label="Prototyping" />
      </Stack>

    </div>
  );
}

export default Provenance;
